import React, { memo } from 'react';
import { Routes, Route } from 'react-router-dom';


const App = memo(() => {
    return (
        <div>
            <Header />
            <Navbar />

            <Routes>
                <Route path='' exact element={<Main />} />
            </Routes>

            <Footer />
        </div>
    );
});

export default App;
